`;

const MascotBottom = styled.img`
  display: block;
  margin: 2rem auto 0 auto;
  width: 210px;
  height: auto;
  image-rendering: pixelated;
  filter: drop-shadow(0 8px 32px #c97d3d44);
  @media (max-width: 700px) {
    width: 120px;
    margin-top: 1.2rem;
  }
`;

const BottomSection = styled.section`
  width: 100vw;
  background: ${primary};
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: flex-start;
  padding: 0 0 2.5rem 0;
  margin-top: 0;
  border-radius: 0 0 1.5rem 1.5rem;
  min-height: 320px;
  position: relative;
  z-index: 11;
  overflow: hidden;
  @media (max-width: 700px) {
    border-radius: 0 0 0.7rem 0.7rem;
    min-height: 180px;
  }
`;

const BottomBuyButton = styled.a`
  display: block;
  margin: 2.2rem auto 0 auto;
  background: #f7eee1;
  color: ${primary};
  font-family: ${pixelFont};
  font-size: 2rem;
  font-weight: bold;
  border: 4px solid ${richBrown};
  border-radius: 2.5rem;
  padding: 1.2rem 3.5rem;
  box-shadow: 0 4px 0 0 ${richBrown};
  text-align: center;
  text-decoration: none;
  transition: background 0.18s, color 0.18s, border 0.18s, box-shadow 0.18s;
  cursor: pointer;
  &:hover {
    background: ${accent};
    color: #fff8e1;
    border: 4px solid ${accent};
    box-shadow: 0 8px 24px ${accent}66;
  }
  @media (max-width: 700px) {
    font-size: 1.1rem;
    padding: 0.7rem 1.5rem;
  }
`;

const BottomSubtext = styled.div`
  color: ${richBrown};
  font-family: ${pixelFont};
  font-size: 1rem;
  margin: 1.5rem auto 0 auto;
  opacity: 0.7;
  text-align: center;
  @media (max-width: 700px) {
    font-size: 0.8rem;
    margin: 0.8rem auto 0 auto;
  }
`;

const BottomMascot = styled.img`
  display: block;
  margin: 2.5rem auto 0 auto;
  width: 210px;
  height: auto;
  image-rendering: pixelated;
  filter: drop-shadow(0 8px 32px #c97d3d44);
  border-radius: 1.2rem 1.2rem 2.5rem 2.5rem;
  @media (max-width: 700px) {
    width: 120px;
    margin-top: 1.2rem;
  }
`;

function App() {
  return (
    <>
      <AnimatedBg />
      <Navbar>
        <NavbarToken>$JIGGIT</NavbarToken>
        <NavbarIcons>
          {/* Example icons, replace href and icons as needed */}
          <NavbarIcon href="#"><i className="fa fa-paper-plane" /></NavbarIcon>
          <NavbarIcon href="#"><i className="fa fa-times" /></NavbarIcon>
          <NavbarIcon href="#"><i className="fa fa-podcast" /></NavbarIcon>
          <NavbarIcon href="#"><i className="fa fa-user-secret" /></NavbarIcon>
          <NavbarIcon href="#"><i className="fa fa-gift" /></NavbarIcon>
        </NavbarIcons>
        <NavbarBuyButton href="#buy" target="_blank" rel="noopener noreferrer">Buy $JIGGIT</NavbarBuyButton>
      </Navbar>
      <AppContainer>
        <HeroSection />
        <Roadmap />
      </AppContainer>
      <BottomSection>
        <BottomBuyButton href="#buy" target="_blank" rel="noopener noreferrer">Buy $Jiggit</BottomBuyButton>
        <BottomSubtext>→ Powered by Jiggit token team</BottomSubtext>
        <BottomMascot src="/assets/mascot_bottom.png" alt="Jiggit Mascot" />
      </BottomSection>
    </>
  );
}

export default App;
